import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import { CheckCircle, ExternalLink, Star, Calendar, DollarSign, FileText, Award, MapPin, User, Video } from 'lucide-react';

// Mock data - in real app, this would come from API based on profile
const mockSchemes = [
  {
    id: 1,
    name: "PM Kisan Samman Nidhi",
    description: "Direct income support of ₹6,000 per year to eligible farmer families",
    category: "Agriculture",
    eligibility: ["Small and marginal farmers", "Family income below ₹8 lakh", "Landholding up to 2 hectares"],
    documents: [
      "Aadhaar Card",
      "Land Records",
      "Bank Account Details",
      "Income Certificate",
      "Caste Certificate (if applicable)"
    ],
    benefits: "₹6,000 per year in 3 installments",
    deadline: "Ongoing",
    applicationLink: "https://pmkisan.gov.in",
    matchScore: 95
  },
  {
    id: 2,
    name: "PM Fasal Bima Yojana",
    description: "Crop insurance scheme to protect farmers against crop loss",
    category: "Agriculture",
    eligibility: ["All farmers", "Crop cultivation", "Valid land records"],
    documents: [
      "Aadhaar Card",
      "Land Records",
      "Bank Account Details",
      "Crop Details",
      "Previous Insurance Details"
    ],
    benefits: "Up to 100% crop loss coverage",
    deadline: "Before sowing season",
    applicationLink: "https://pmfby.gov.in",
    matchScore: 88
  },
  {
    id: 3,
    name: "PM Ujjwala Yojana",
    description: "Free LPG connection to women from BPL households",
    category: "Women Empowerment",
    eligibility: ["Women from BPL households", "No existing LPG connection", "Aadhaar linked bank account"],
    documents: [
      "Aadhaar Card",
      "BPL Certificate",
      "Bank Account Details",
      "Address Proof",
      "Income Certificate"
    ],
    benefits: "Free LPG connection and first refill",
    deadline: "Ongoing",
    applicationLink: "https://pmuy.gov.in",
    matchScore: 82
  },
  {
    id: 4,
    name: "PM Awas Yojana",
    description: "Housing for All - affordable housing for urban and rural poor",
    category: "Housing",
    eligibility: ["Economically weaker sections", "Income below ₹3 lakh", "No pucca house"],
    documents: [
      "Aadhaar Card",
      "Income Certificate",
      "Caste Certificate",
      "Address Proof",
      "Land Documents",
      "Bank Account Details"
    ],
    benefits: "Up to ₹2.5 lakh subsidy for house construction",
    deadline: "Ongoing",
    applicationLink: "https://pmay.gov.in",
    matchScore: 78
  }
];

const SchemeMatcher = () => {
  const [schemes, setSchemes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [selectedScheme, setSelectedScheme] = useState(null);

  useEffect(() => {
    // Simulate API call
    setTimeout(() => {
      setSchemes(mockSchemes);
      setLoading(false);
    }, 1000);
  }, []);

  const handleSchemeClick = (scheme) => {
    setSelectedScheme(scheme);
  };

  const closeModal = () => {
    setSelectedScheme(null);
  };

  if (loading) {
    return (
      <div className="scheme-matcher">
        <div className="loading-container">
          <div className="loading-spinner"></div>
          <p>Finding the best schemes for you...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="scheme-matcher">
      <div className="scheme-container">
        <div className="scheme-header">
          <h1>Your Eligible Schemes</h1>
          <p>Based on your profile, here are the schemes you're eligible for</p>
        </div>

        <div className="schemes-grid">
          {schemes.map((scheme) => (
            <div key={scheme.id} className="scheme-card" onClick={() => handleSchemeClick(scheme)}>
              <div className="scheme-header-card">
                <div className="scheme-match-score">
                  <Star className="star-icon" />
                  <span>{scheme.matchScore}% Match</span>
                </div>
                <div className="scheme-category">{scheme.category}</div>
              </div>
              
              <h3 className="scheme-name">{scheme.name}</h3>
              <p className="scheme-description">{scheme.description}</p>
              
              <div className="scheme-benefits">
                <DollarSign className="benefit-icon" />
                <span>{scheme.benefits}</span>
              </div>
              
              <div className="scheme-deadline">
                <Calendar className="deadline-icon" />
                <span>Deadline: {scheme.deadline}</span>
              </div>
              
              <button className="view-details-btn">View Details</button>
            </div>
          ))}
        </div>

        {/* Scheme Details Modal */}
        {selectedScheme && (
          <div className="modal-overlay" onClick={closeModal}>
            <div className="scheme-modal" onClick={(e) => e.stopPropagation()}>
              <div className="modal-header">
                <h2>{selectedScheme.name}</h2>
                <button className="close-btn" onClick={closeModal}>×</button>
              </div>
              
              <div className="modal-content">
                <div className="scheme-info">
                  <p className="scheme-description-full">{selectedScheme.description}</p>
                  
                  <div className="info-section">
                    <h3>Eligibility Criteria</h3>
                    <ul>
                      {selectedScheme.eligibility.map((criteria, index) => (
                        <li key={index}>
                          <CheckCircle className="check-icon" />
                          {criteria}
                        </li>
                      ))}
                    </ul>
                  </div>
                  
                  <div className="info-section">
                    <h3>Required Documents</h3>
                    <ul>
                      {selectedScheme.documents.map((doc, index) => (
                        <li key={index}>
                          <FileText className="doc-icon" />
                          {doc}
                        </li>
                      ))}
                    </ul>
                  </div>
                  
                  <div className="info-section">
                    <h3>Benefits</h3>
                    <p className="benefits-text">{selectedScheme.benefits}</p>
                  </div>
                  
                  <div className="info-section">
                    <h3>Application Process</h3>
                    <ol>
                      <li>Gather all required documents</li>
                      <li>Visit the official website</li>
                      <li>Fill the application form</li>
                      <li>Upload required documents</li>
                      <li>Submit and track your application</li>
                    </ol>
                  </div>
                </div>
                
                <div className="modal-actions">
                  <a 
                    href={selectedScheme.applicationLink} 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="apply-btn"
                  >
                    <ExternalLink className="link-icon" />
                    Apply Now
                  </a>
                  <button className="save-btn">Save for Later</button>
                </div>
              </div>
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default SchemeMatcher;
